import React from 'react';
import './index.css'

let c = 0
const IncNum = (()=>{
    c = c + 1
})

const App = (()=>{
    return (
        <>
        <div className='container'>
        <h1 className='counter'>{c}</h1>
        <button className='click' onClick={IncNum}>click Me</button>
        </div>
        </>
    )
})
export default App
